 -
  description: "02.sql"
  input:
   - "-- tpch2 using 1395599672 as a seed to the RNG"
   - "select"
   - "  s.s_acctbal,"
   - "  s.s_name,"
   - "  n.n_name,"
   - "  p.p_partkey,"
   - "  p.p_mfgr,"
   - "  s.s_address,"
   - "  s.s_phone,"
   - "  s.s_comment"
   - "from"
   - "  cp.\"tpch/part.parquet\" p,"
   - "  cp.\"tpch/supplier.parquet\" s,"
   - "  cp.\"tpch/partsupp.parquet\" ps,"
   - "  cp.\"tpch/nation.parquet\" n,"
   - "  cp.\"tpch/region.parquet\" r"
   - "where"
   - "  p.p_partkey = ps.ps_partkey"
   - "  and s.s_suppkey = ps.ps_suppkey"
   - "  and p.p_size = 41"
   - "  and p.p_type like '%NICKEL'"
   - "  and s.s_nationkey = n.n_nationkey"
   - "  and n.n_regionkey = r.r_regionkey"
   - "  and r.r_name = 'EUROPE'"
   - "  and ps.ps_supplycost = ("
   - ""
   - "    select"
   - "      min(ps.ps_supplycost)"
   - ""
   - "    from"
   - "      cp.\"tpch/partsupp.parquet\" ps,"
   - "      cp.\"tpch/supplier.parquet\" s,"
   - "      cp.\"tpch/nation.parquet\" n,"
   - "      cp.\"tpch/region.parquet\" r"
   - "    where"
   - "      p.p_partkey = ps.ps_partkey"
   - "      and s.s_suppkey = ps.ps_suppkey"
   - "      and s.s_nationkey = n.n_nationkey"
   - "      and n.n_regionkey = r.r_regionkey"
   - "      and r.r_name = 'EUROPE'"
   - "  )"
   - ""
   - "order by"
   - "  s.s_acctbal desc,"
   - "  n.n_name,"
   - "  s.s_name,"
   - "  p.p_partkey"
   - "limit 100 "
  output:
    queryPlanText:
     - "LogicalSort(sort0=[$0], sort1=[$2], sort2=[$1], sort3=[$3], dir0=[DESC], dir1=[ASC], dir2=[ASC], dir3=[ASC], fetch=[100])"
     - "  LogicalProject(s_acctbal=[$14], s_name=[$10], n_name=[$22], p_partkey=[$0], p_mfgr=[$2], s_address=[$11], s_phone=[$13], s_comment=[$15])"
     - "    LogicalFilter(condition=[AND(=($0, $16), =($9, $17), =($5, 41), LIKE($4, '%NICKEL':VARCHAR(7)), =($12, $21), =($23, $25), =($26, 'EUROPE'), =($19, $28))])"
     - "      LogicalCorrelate(correlation=[$cor0], joinType=[left], requiredColumns=[{0}])"
     - "        LogicalJoin(condition=[true], joinType=[inner])"
     - "          LogicalJoin(condition=[true], joinType=[inner])"
     - "            LogicalJoin(condition=[true], joinType=[inner])"
     - "              LogicalJoin(condition=[true], joinType=[inner])"
     - "                LogicalTableScan(table=[[cp, tpch/part.parquet]])"
     - "                LogicalTableScan(table=[[cp, tpch/supplier.parquet]])"
     - "              LogicalTableScan(table=[[cp, tpch/partsupp.parquet]])"
     - "            LogicalTableScan(table=[[cp, tpch/nation.parquet]])"
     - "          LogicalTableScan(table=[[cp, tpch/region.parquet]])"
     - "        LogicalAggregate(group=[{}], EXPR$0=[MIN($0)])"
     - "          LogicalProject(PS_SUPPLYCOST=[$3])"
     - "            LogicalFilter(condition=[AND(=($cor0.P_PARTKEY, $0), =($5, $1), =($8, $12), =($14, $16), =($17, 'EUROPE'))])"
     - "              LogicalJoin(condition=[true], joinType=[inner])"
     - "                LogicalJoin(condition=[true], joinType=[inner])"
     - "                  LogicalJoin(condition=[true], joinType=[inner])"
     - "                    LogicalTableScan(table=[[cp, tpch/partsupp.parquet]])"
     - "                    LogicalTableScan(table=[[cp, tpch/supplier.parquet]])"
     - "                  LogicalTableScan(table=[[cp, tpch/nation.parquet]])"
     - "                LogicalTableScan(table=[[cp, tpch/region.parquet]])"
