  description: "10.sql"
  input:
   - "-- tpch10 using 1395599672 as a seed to the RNG"
   - "select"
   - "  c.c_custkey,"
   - "  c.c_name,"
   - "  sum(l.l_extendedprice * (1 - l.l_discount)) as revenue,"
   - "  c.c_acctbal,"
   - "  n.n_name,"
   - "  c.c_address,"
   - "  c.c_phone,"
   - "  c.c_comment"
   - "from"
   - "  cp.\"tpch/customer.parquet\" c,"
   - "  cp.\"tpch/orders.parquet\" o,"
   - "  cp.\"tpch/lineitem.parquet\" l,"
   - "  cp.\"tpch/nation.parquet\" n"
   - "where"
   - "  c.c_custkey = o.o_custkey"
   - "  and l.l_orderkey = o.o_orderkey"
   - "  and o.o_orderdate >= date '1994-03-01'"
   - "  and o.o_orderdate < date '1994-03-01' + interval '3' month"
   - "  and l.l_returnflag = 'R'"
   - "  and c.c_nationkey = n.n_nationkey"
   - "group by"
   - "  c.c_custkey,"
   - "  c.c_name,"
   - "  c.c_acctbal,"
   - "  c.c_phone,"
   - "  n.n_name,"
   - "  c.c_address,"
   - "  c.c_comment"
   - "order by"
   - "  revenue desc"
   - "limit 20 "
  output:
    queryPlanText:
     - "LogicalSort(sort0=[$2], dir0=[DESC], fetch=[20])"
     - "  LogicalProject(c_custkey=[$0], c_name=[$1], revenue=[$7], c_acctbal=[$2], n_name=[$4], c_address=[$5], c_phone=[$3], c_comment=[$6])"
