     - "          LogicalTableScan(table=[[cp, tpch/supplier.parquet]])"
     - "          LogicalTableScan(table=[[cp, tpch/nation.parquet]])"
     - "        LogicalAggregate(group=[{0}])"
     - "          LogicalProject(ps_suppkey=[$1])"
     - "            LogicalFilter(condition=[AND(true, >($2, $6))])"
     - "              LogicalCorrelate(correlation=[$cor0], joinType=[left], requiredColumns=[{0, 1}])"
     - "                LogicalJoin(condition=[=($0, $5)], joinType=[inner])"
     - "                  LogicalTableScan(table=[[cp, tpch/partsupp.parquet]])"
     - "                  LogicalAggregate(group=[{0}])"
     - "                    LogicalProject(p_partkey=[$0])"
     - "                      LogicalFilter(condition=[LIKE($1, 'antique%':VARCHAR(8))])"
     - "                        LogicalTableScan(table=[[cp, tpch/part.parquet]])"
     - "                LogicalProject(EXPR$0=[*(0.5:DECIMAL(2, 1), $0)])"
     - "                  LogicalAggregate(group=[{}], agg#0=[SUM($0)])"
     - "                    LogicalProject(L_QUANTITY=[$4])"
