  description: "22.sql"
  input:
   - "-- tpch22 using 1395599672 as a seed to the RNG"
   - "select"
   - "  cntrycode,"
   - "  count(*) as numcust,"
   - "  sum(c_acctbal) as totacctbal"
   - "from"
   - "  ("
   - "    select"
   - "      substring(c_phone from 1 for 2) as cntrycode,"
   - "      c_acctbal"
   - "    from"
   - "      cp.\"tpch/customer.parquet\" c"
   - "    where"
   - "      substring(c_phone from 1 for 2) in"
   - "        ('24', '31', '11', '16', '21', '20', '34')"
   - "      and c_acctbal > ("
   - "        select"
   - "          avg(c_acctbal)"
   - "        from"
   - "          cp.\"tpch/customer.parquet\""
   - "        where"
   - "          c_acctbal > 0.00"
   - "          and substring(c_phone from 1 for 2) in"
   - "            ('24', '31', '11', '16', '21', '20', '34')"
   - "      )"
   - "      and not exists ("
   - "        select"
   - "          *"
   - "        from"
   - "          cp.\"tpch/orders.parquet\" o"
   - "        where"
   - "          o.o_custkey = c.c_custkey"
   - "      )"
   - "  ) as custsale"
   - "group by"
   - "  cntrycode"
   - "order by"
   - "  cntrycode "
  output:
    queryPlanText:
     - "LogicalSort(sort0=[$0], dir0=[ASC])"
     - "  LogicalAggregate(group=[{0}], numcust=[COUNT()], totacctbal=[SUM($1)])"
     - "    LogicalProject(cntrycode=[SUBSTRING($4, 1, 2)], c_acctbal=[$5])"
     - "      LogicalFilter(condition=[AND(OR(=(SUBSTRING($4, 1, 2), '24':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '31':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '11':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '16':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '21':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '20':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '34':VARCHAR(2))), >($5, $8), NOT(IS NOT NULL($9)))])"
     - "        LogicalCorrelate(correlation=[$cor0], joinType=[left], requiredColumns=[{0}])"
     - "          LogicalJoin(condition=[true], joinType=[left])"
     - "            LogicalTableScan(table=[[cp, tpch/customer.parquet]])"
     - "            LogicalAggregate(group=[{}], EXPR$0=[AVG($0)])"
     - "              LogicalProject(C_ACCTBAL=[$5])"
     - "                LogicalFilter(condition=[AND(>($5, 0.00:DECIMAL(3, 2)), OR(=(SUBSTRING($4, 1, 2), '24':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '31':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '11':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '16':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '21':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '20':VARCHAR(2)), =(SUBSTRING($4, 1, 2), '34':VARCHAR(2))))])"
     - "                  LogicalTableScan(table=[[cp, tpch/customer.parquet]])"
     - "          LogicalAggregate(group=[{}], agg#0=[MIN($0)])"
     - "            LogicalProject($f0=[1:BIGINT])"
     - "              LogicalProject(O_ORDERKEY=[$0], O_CUSTKEY=[$1], O_ORDERSTATUS=[$2], O_TOTALPRICE=[$3], O_ORDERDATE=[$4], O_ORDERPRIORITY=[$5], O_CLERK=[$6], O_SHIPPRIORITY=[$7], O_COMMENT=[$8])"
     - "                LogicalFilter(condition=[=($1, $cor0.C_CUSTKEY)])"
     - "                  LogicalTableScan(table=[[cp, tpch/orders.parquet]])"
    queryPlanBinary: ""
